pragma solidity 0.7.6;

import '@openzeppelin/contracts/token/ERC20/ERC20Capped.sol';
import '../interfaces/IFeeCalculater.sol';
import '../interfaces/IInvite.sol';                                                                                                                                                                                                  
import '../core/SafeOwnable.sol';
import 'hardhat/console.sol';

contract MVPToken is ERC20Capped, SafeOwnable {
    using SafeMath for uint256;

    event MinterChanged(address indexed minter, uint maxAmount);

    uint256 public constant MAX_SUPPLY = 1 * 10 ** 7 * 10 ** 18;
    address public constant BURN_ADDRESS = 0x000000000000000000000000000000000000dEaD; 
    uint FEE_BASE = 1e6;
    uint256 public immutable MAX_BURN_AMOUNT = MAX_SUPPLY.sub(21000);

    mapping(address => uint) public minters;
    uint minBindFee = 10000000000000;
    uint maxFeePercent = 100000;
    IInvite invite;
    IFeeCalculater feeCalculater;

    constructor() ERC20Capped(MAX_SUPPLY) ERC20("MVP Token", "MVP") SafeOwnable(msg.sender) {
        addMinter(msg.sender, uint(-1));
    }

    function getInvite() external view onlyOwner returns (IInvite) {
        return invite;
    }

    function getFeeCalculater() external view onlyOwner returns (IFeeCalculater) {
        return feeCalculater;
    }

    function addMinter(address _minter, uint _maxAmount) public onlyOwner {
        require(_minter != address(0), "illegal minter");
        require(minters[_minter] == 0, "already minter");
        minters[_minter] = _maxAmount;
        emit MinterChanged(_minter, _maxAmount);
    }

    function delMinter(address _minter) public onlyOwner {
        require(_minter != address(0), "illegal minter");
        require(minters[_minter] > 0, "not minter");
        delete minters[_minter];
        emit MinterChanged(_minter, 0);
    }

    modifier onlyMinter(uint _amount) {
        require(minters[msg.sender] >= _amount, "caller is not minter or not enough");
        _;
    }

    function setMinBindFee(uint _minBindFee) external onlyOwner {
        minBindFee = _minBindFee;
    }

    function setMaxFeePercent(uint _maxFeePercent) external onlyOwner {
        maxFeePercent = _maxFeePercent;
    }

    function setInvite(IInvite _invite) external onlyOwner {
        invite = _invite;
    }

    function setFeeCalculater(IFeeCalculater _feeCalculater) external onlyOwner {
        feeCalculater = _feeCalculater;
    }

    function mint(address to, uint256 amount) public onlyMinter(amount) returns (uint) {
        if (amount > MAX_SUPPLY.sub(totalSupply())) {
            return 0;
        }
        if (minters[msg.sender] < amount) {
            amount = minters[msg.sender];
        }
        minters[msg.sender] = minters[msg.sender].sub(amount);
        _mint(to, amount);
        return amount; 
    }

    function bindRelation(address _from, address _to, uint _amount) internal {
        if (address(invite) == address(0)) { //function closed
            return;
        }
        if (_amount < minBindFee) { //too fewer
            return;
        }
        invite.bindRelation(_to, _from);
    }

    function calculateTokenFee(
        address _operator, address _sender, address _recipient, uint _amount
    ) internal returns(uint _remainAmount) {
        _remainAmount = _amount;
        if (address(feeCalculater) == address(0)) {
            return _remainAmount;
        }
        uint feeAmount = _amount.mul(maxFeePercent).div(FEE_BASE);
        (address[] memory users, uint[] memory amounts) = feeCalculater.calculateTokenFee(_operator, _sender, _recipient, _amount, feeAmount);
        for (uint i = 0; i < users.length; i ++) {
            if (users[i] == BURN_ADDRESS) {
                uint currentBurnAmount = balanceOf(BURN_ADDRESS);
                if (currentBurnAmount >= MAX_BURN_AMOUNT) {
                    continue;
                } else {
                    uint remainAmount = MAX_BURN_AMOUNT.sub(currentBurnAmount);
                    if (amounts[i] > remainAmount) {
                        amounts[i] = remainAmount;
                    }
                }
            }
            if (amounts[i] > 0 && users[i] != address(0)) {
                _transfer(_sender, users[i], amounts[i]);
                _remainAmount = _remainAmount.sub(amounts[i]);
            }
        }
    }

    function transfer(address _recipient, uint256 _amount) public override returns (bool) {
        bindRelation(_msgSender(), _recipient, _amount);
        _amount = calculateTokenFee(address(0), _msgSender(), _recipient, _amount);
        _transfer(_msgSender(), _recipient, _amount);
        return true;
    }

    function transferFrom(address _sender, address _recipient, uint256 _amount) public virtual override returns (bool) {
        bindRelation(_msgSender(), _recipient, _amount);
        _amount = calculateTokenFee(_msgSender(), _sender, _recipient, _amount);
        _transfer(_sender, _recipient, _amount);
        _approve(_sender, _msgSender(), allowance(_sender, _msgSender()).sub(_amount));
        return true;
    }
}
